import "./testimonials.scss";

export default function Testimonials() {
  return (
    <div className="testimonials" id="testimonials">
      <div className="content">
        <img src="assets/stackedbooks1.gif" alt="" />
        <h1>Thurgood attended Frederick Douglas high school and was the leader of many different clubs.</h1>
        <h1>At Frederick Douglass High School, Marshall was one of the top-achievers in class</h1>
        <h1>He was so brilliant that he graduated a whole year ahead of his peers in 1925 and was placed in the top three ranks.</h1>
        <h1>Mr. Marshall had to memorize the U.S. Constitution in high school as punishment for misbehaving in class.</h1>
      </div>
    </div>

  )
}
